**Describe the bug**
Hi everyone,
I dunno if it's a bug or a wrong use of ONNX, but the basic idea is to make some multi thread call of ONNX using a single session. Using python seems really convenient for this, but problem comes with CPP. See the examples bellow:

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Ubuntu 21
- ONNX Runtime installed from (source or binary): 1.11
- Python version: 3.9.7

**To Reproduce**
From Python code
```
# imports
from multiprocessing.pool import ThreadPool
import onnxruntime
import numpy
import time
import os

THREAD_NUMBER = 100

# Prepare inference
ort_session_options = onnxruntime.SessionOptions()
ort_session_options.add_session_config_entry("session.set_denormal_as_zero", "1")
ort_session = onnxruntime.InferenceSession("./model.onnx", ort_session_options)

# Shape reading
input_shape = ort_session.get_inputs()[0].shape
print(f"Detected shape : {input_shape}")

# zero input
input_var = numpy.zeros(input_shape).astype(numpy.float32)

# zero inference
# Pooling test
pool = ThreadPool(THREAD_NUMBER)
## Original pred
def f_python_onnx(input_var):
    print("Start Id", threading.get_native_id())
    ort_inputs = {ort_session.get_inputs()[0].name: input_var}
    ort_session.run(None, ort_inputs)[0]
    print("End Id", threading.get_native_id())

t0 = time.time()
pool.map(f_python_onnx, [input_var]*THREAD_NUMBER)
t_orig = time.time() - t0
```
Everything seems to be fine here. So Ok, let's go with CPP:

```
#include <thread>
