            Ort::Value::CreateTensor<float>(
                        memoryInfo, inputData.data(), 
                        inputTensorSize, inputDims.data(),
                        inputDims.size()));

    // Prepare output tensor
    size_t outputTensorSize = vectorProduct(outputDims);
    std::vector<float> outputData(outputTensorSize);
    std::vector<const char*> outputNames{outputName};
    std::vector<Ort::Value> outputTensors;
    outputTensors.push_back(
            Ort::Value::CreateTensor<float>(
                        memoryInfo, outputData.data(), 
                        outputTensorSize, outputDims.data(), 
                        outputDims.size()));

    // Run the inference !!!!
    pSession->Run(
            Ort::RunOptions{nullptr}, inputNames.data(),
            inputTensors.data(), 1, outputNames.data(),
            outputTensors.data(), 1);

    return;
}

int main() {
    int THREAD_NUMBER = 100
    // Session parameters
    Ort::Env env(OrtLoggingLevel::ORT_LOGGING_LEVEL_WARNING, SESSION_NAME);
    Ort::SessionOptions sessionOptions;
    sessionOptions.AddConfigEntry(kOrtSessionOptionsConfigSetDenormalAsZero, "1");

    // Create session and prepare input / output
    Ort::Session* pSession = new Ort::Session(env, "model.onnx", sessionOptions);
    
    // Threading
    std::vector<std::thread> threads; 
    for (int i = 0; i < THREAD_NUMBER; i++) {
        threads.push_back(std::thread(forward, pSession, i));
    }
    
    for (auto &th : threads) {
        th.join();
    }
    delete pSession;
    return 0;
}
